assuming you're not joking (it's hard to tell xD) then I'll give an overview of OOP. It's way too complicated to explain all in one comment. You can see the KA courses for more detailed explanations: https://www.khanacademy.org/computing/computer-programming/programming#object-oriented

Here's my explanation.

OOP (Object-Oriented Programming) is programming that centers around using objects. Objects are defined using curly braces `{}` and have "keys" and "values." All keys must be unique. Values can be whatever you want, even other objects. For each key, there is exactly one value. You can assign a key to a value inside the object like this:```var myObject = {
  "test_value": "wHheeeEEE",
  "numbers": 123,
  "array": [5, 7, true, false, [0, 1]],
}```The values can be anything: images, functions, arrays, raw data types, objects, variables, etc. You can access a value inside an object by using its key. For example, you might access `123` by typing `myObject.numbers`. You can access `"wHheeeEEE"` by typing `myObject.test_value`. Etc.

Object-Oriented Programming is when you pass arguments to a constructor, which if a functions that defines many properties on a keyword named `this`. `this` refers to the current object scope. In the following example, `this` would reference `myObject2`.```var myObject2 = {
  "name": ["Ibraheem", "Ahmed"],
  "initials": this.name[0][0] + this.name[1][0]
};```When you assign properties to `this` inside a function, it allows you to do neat stuff on it's `prototype`. At this point, my knowledge is a bit limited, so I recommend looking at the KA course (https://www.khanacademy.org/computing/computer-programming/programming#object-oriented)

